import React from "react";
const msg = [
  {
    id: 1,
    attributes: {
      name: "孙悟空",
      gender: "男",
      age: 18,
      address: "花果山",
    },
  },
];
const App = () => {
  return (
    <div>
      <ul>
        <li>孙悟空 男 18 花果山</li>
      </ul>
    </div>
  );
};

export default App;
